INSERT INTO `config_info` VALUES (121, 'application-dev.yml', 'DEFAULT_GROUP', 'spring:\n  test: test\n  http:\n    multipart:\n      max-file-size: -1\n      max-request-size: -1\n  main:\n    allow-circular-references: true\n    allow-bean-definition-overriding: true\n  autoconfigure:\n    exclude: com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n  mvc:\n    pathmatch:\n      matching-strategy: ant_path_matcher\n  cloud:\n    sentinel:\n      filter:\n        # sentinel 在 springboot 2.6.x 不兼容问题的处理\n        enabled: false\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', 'd38ec822bfc7a52185a01648254282ab', '2023-06-23 03:16:07', '2023-06-23 13:03:18', NULL, '0:0:0:0:0:0:0:1', '', 'f88f5e28-5c99-4223-aac6-c9bb8dba67c5', '', '', '', 'yaml', '', '');
INSERT INTO `config_info` VALUES (130, 'bing-system-dev.yml', 'DEFAULT_GROUP', '# spring配置\nspring:\n  kafka:\n    bootstrap-servers: 192.168.47.129:9092\n    producer:\n      key-serializer: org.apache.kafka.common.serialization.StringSerializer\n      value-serializer: org.apache.kafka.common.serialization.StringSerializer\n    # consumer:\n    #   key-deserializer: org.apache.kafka.common.serialization.StringDeserializer\n    #   value-deserializer: org.apache.kafka.common.serialization.StringDeserializer\n    #   group-id: test-consumer-group\n  rabbitmq:\n    addresses: 192.168.47.129\n    port: 5672\n    username: admin\n    password: admin\n    virtual-host: /\n  mq: \n    redis: \n      maxConsumer: 5\n      retryTimes: 5\n      startConsumerThread: true\n  redis:\n    host: 127.0.0.1\n    port: 6379\n    database: 3\n  datasource:\n    druid:\n      stat-view-servlet:\n        enabled: true\n        loginUsername: admin\n        loginPassword: 123456\n    dynamic:\n      druid:\n        primary: master\n        initial-size: 5\n        min-idle: 5\n        maxActive: 20\n        maxWait: 60000\n        timeBetweenEvictionRunsMillis: 60000\n        minEvictableIdleTimeMillis: 300000\n        validationQuery: SELECT 1 FROM DUAL\n        testWhileIdle: true\n        testOnBorrow: false\n        testOnReturn: false\n        poolPreparedStatements: true\n        maxPoolPreparedStatementPerConnectionSize: 20\n        filters: stat,slf4j\n        connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\n      datasource:\n          # 主库数据源\n          master:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://127.0.0.1:3306/bing-cloud?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            username: root\n            password: root\n          # 从库数据源\n          # slave:\n            # username: \n            # password: \n            # url: \n            # driver-class-name: \n      # seata: true    # 开启seata代理，开启后默认每个数据源都代理，如果某个不需要代理可单独关闭\n\n# seata配置\nseata:\n  # 默认关闭，如需启用spring.datasource.dynami.seata需要同时开启\n  enabled: false\n  # Seata 应用编号，默认为 ${spring.application.name}\n  application-id: ${spring.application.name}\n  # Seata 事务组编号，用于 TC 集群名\n  tx-service-group: ${spring.application.name}-group\n  # 关闭自动代理\n  enable-auto-data-source-proxy: false\n  # 服务配置项\n  service:\n    # 虚拟组和分组的映射\n    vgroup-mapping:\n      ruoyi-system-group: default\n  config:\n    type: nacos\n    nacos:\n      serverAddr: 127.0.0.1:8848\n      group: SEATA_GROUP\n      namespace:\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 127.0.0.1:8848\n      namespace:\n\nlogging:\n  level:\n    com.bing.mapper: debug  ', '39c232f717811944eb54e443fd22f067', '2023-06-23 04:20:06', '2023-06-24 08:06:13', NULL, '0:0:0:0:0:0:0:1', '', 'f88f5e28-5c99-4223-aac6-c9bb8dba67c5', '', '', '', 'yaml', '', '');
INSERT INTO `config_info` VALUES (141, 'message-center-dev.yml', 'DEFAULT_GROUP', '# spring配置\nspring:\n  kafka:\n    bootstrap-servers: 192.168.47.129:9092\n    # producer:\n    #   key-serializer: org.apache.kafka.common.serialization.StringSerializer\n    #   value-serializer: org.apache.kafka.common.serialization.StringSerializer\n    consumer:\n      key-deserializer: org.apache.kafka.common.serialization.StringDeserializer\n      value-deserializer: org.apache.kafka.common.serialization.StringDeserializer\n      group-id: test-consumer-group\n  rabbitmq:\n    addresses: 192.168.47.129\n    port: 5672\n    username: admin\n    password: admin\n    virtual-host: /\n  mq: \n    redis: \n      maxConsumer: 5\n      retryTimes: 5\n      startConsumerThread: true\n  redis:\n    host: 127.0.0.1\n    port: 6379\n  datasource:\n    druid:\n      stat-view-servlet:\n        enabled: true\n        loginUsername: admin\n        loginPassword: 123456\n    dynamic:\n      druid:\n        initial-size: 5\n        min-idle: 5\n        maxActive: 20\n        maxWait: 60000\n        timeBetweenEvictionRunsMillis: 60000\n        minEvictableIdleTimeMillis: 300000\n        validationQuery: SELECT 1 FROM DUAL\n        testWhileIdle: true\n        testOnBorrow: false\n        testOnReturn: false\n        poolPreparedStatements: true\n        maxPoolPreparedStatementPerConnectionSize: 20\n        filters: stat,slf4j\n        connectionProperties: druid.stat.mergeSql\\=true;druid.stat.slowSqlMillis\\=5000\n      datasource:\n          # 主库数据源\n          master:\n            driver-class-name: com.mysql.cj.jdbc.Driver\n            url: jdbc:mysql://127.0.0.1:3306/base_sms?useUnicode=true&characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=true&serverTimezone=GMT%2B8\n            username: root\n            password: root\n          # 从库数据源\n          # slave:\n            # username: \n            # password: \n            # url: \n            # driver-class-name: \n      # seata: true    # 开启seata代理，开启后默认每个数据源都代理，如果某个不需要代理可单独关闭\n\n# seata配置\nseata:\n  # 默认关闭，如需启用spring.datasource.dynami.seata需要同时开启\n  enabled: false\n  # Seata 应用编号，默认为 ${spring.application.name}\n  application-id: ${spring.application.name}\n  # Seata 事务组编号，用于 TC 集群名\n  tx-service-group: ${spring.application.name}-group\n  # 关闭自动代理\n  enable-auto-data-source-proxy: false\n  # 服务配置项\n  service:\n    # 虚拟组和分组的映射\n    vgroup-mapping:\n      ruoyi-system-group: default\n  config:\n    type: nacos\n    nacos:\n      serverAddr: 127.0.0.1:8848\n      group: SEATA_GROUP\n      namespace:\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 127.0.0.1:8848\n      namespace:\n\n# swagger配置\nswagger:\n  title: 消息中心模块接口文档\n  license: Powered By ruoyi\n  licenseUrl: https://ruoyi.vip\n\nsms:\n  sendlimit: 10\n  unvalidtime: 30\n  domain: dysmsapi.aliyuncs.com\n  version: 2017-05-25\n  action: SendSms\n  regionId: cn-hangzhou\n  accessKeyId: LTAIuHTxjotZOE7w\n  secret: Tx0rMUGaYtlwO6D3tN2WEbitnk1XFY\n  product: Dysmsapi\n  querySmsTemAction: QuerySmsTemplate\n  modifySmsTemAction: ModifySmsTemplate\n  addSmsTemAction: AddSmsTemplate\n  delSmsTemAction: DeleteSmsTemplate\n\nsmsAliTemp:\n  addInterval: 30 #单位秒\n  updateInterval: 30 #单位秒\nwx:\n  content: \n    wechatAppId: wxe50cac5f0e806400\n    wechatAppSecret: 1154e970548f362dd0f752403aa3692f\n    wechatToken: r3bfhw05r1yrnh0ubrp0kiwhxe5eogvt\n    wechatEncodingAesKey: FmNRQak4lMnuBHoIX0AW17GBewE9le1APUr2EuRlLrB  ', 'dda14c83d7f3b0dc5c91f7aec0d8efcc', '2023-06-24 06:40:09', '2023-06-24 08:06:32', NULL, '0:0:0:0:0:0:0:1', '', 'f88f5e28-5c99-4223-aac6-c9bb8dba67c5', '', '', '', 'yaml', '', '');

