INSERT INTO `his_config_info` VALUES (2, 1, 'ruoyi-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  redis:\n    host: 127.0.0.1\n    port: 6379\n    password: M2cUOKYgbeWJQU17\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: ruoyi-auth\n          uri: lb://ruoyi-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n            - CacheRequestFilter\n            - ValidateCodeFilter\n            - StripPrefix=1\n        # 代码生成\n        - id: ruoyi-gen\n          uri: lb://ruoyi-gen\n          predicates:\n            - Path=/code/**\n          filters:\n            - StripPrefix=1\n        # 定时任务\n        - id: ruoyi-job\n          uri: lb://ruoyi-job\n          predicates:\n            - Path=/schedule/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: ruoyi-system\n          uri: lb://ruoyi-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n        # 文件服务\n        - id: ruoyi-file\n          uri: lb://ruoyi-file\n          predicates:\n            - Path=/file/**\n          filters:\n            - StripPrefix=1\n        - id: message-center\n          uri: lb://message-center\n          predicates:\n            - Path=/message/**\n          filters:\n            - StripPrefix=1\n        - id: blood-sugar\n          uri: lb://blood-sugar\n          predicates:\n            - Path=/bloodsugar/**\n          filters:\n            - StripPrefix=1\n        - id: big-screen\n          uri: lb://big-screen\n          predicates:\n            - Path=/bigscreen/**\n          filters:\n            - StripPrefix=1    \n        - id: device-manage\n          uri: lb://device-manage\n          predicates:\n            - Path=/devicemanage/**\n          filters:\n            - StripPrefix=1      \n        - id: patient-wx-program\n          uri: lb://patient-wx-program\n          predicates:\n            - Path=/patientwxprogram/**\n          filters:\n            - StripPrefix=1     \niot:\n  #url: aitang-m.hsdodxops.com.cn:19999\n  url: 39.106.153.66:19999\n# 安全配置\nsecurity:\n  # 验证码\n  captcha:\n    enabled: true\n    type: math\n  # 防止XSS攻击\n  xss:\n    enabled: true\n    excludeUrls:\n      - /system/notice\n  # 不校验白名单\n  ignore:\n    whites:\n      - /auth/logout\n      - /auth/login\n      - /auth/anyang/login\n      - /auth/bloodsugar/login\n      - /auth/bloodsugar/login/doctor\n      - /auth/social/login\n      - /bloodsugar/doctor/accountRegist\n      - /auth/social/login/doctor\n      - /auth/register\n      - /*/v2/api-docs\n      - /csrf\n      - /message/**\n      - /bloodsugar/register/**\n      - /system/hx/test\n      - /system/notice/list\n      - /patientwxprogram/ecgReport/callBackEcgReport/**\n      - /patientwxprogram/ecgReport/getReportById\n      - /auth/bloodsugar/doctor/testDoctorLogin\n      - /auth/bloodsugar/testPatientLogin\n      - /patientwxprogram/dySyncData/bloodPressure\n      - /patientwxprogram/dySyncData/bloodSugar\n      - /patientwxprogram/fourType/callBackEcgReport/**\n      - /patientwxprogram/fourType/getResultById', 'b2f63e80647a954e25b9dc0b18f60f45', '2023-06-05 08:22:54', '2023-06-05 00:22:55', NULL, '0:0:0:0:0:0:0:1', 'U', '', '');
