INSERT INTO `his_config_info` VALUES (109, 9, 'application-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  http:\n    multipart:\n      max-file-size: -1\n      max-request-size: -1\n  main:\n    allow-circular-references: true\n    allow-bean-definition-overriding: true\n  autoconfigure:\n    exclude: com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n  mvc:\n    pathmatch:\n      matching-strategy: ant_path_matcher\n  cloud:\n    sentinel:\n      filter:\n        # sentinel 在 springboot 2.6.x 不兼容问题的处理\n        enabled: false\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', '4a71bab2712e43e6a30ccf73ff7ff1fa', '2023-06-05 13:48:55', '2023-06-05 05:48:56', NULL, '0:0:0:0:0:0:0:1', 'U', '', '');
INSERT INTO `his_config_info` VALUES (114, 10, 'hsyk-mall-admin-dev', 'DEFAULT_GROUP', '', '## spring security 配置\r\nsecurity:\r\n  oauth2:\r\n    client:\r\n      client-id: weixin\r\n      client-secret: weixin\r\n      scope: server\r\n      # 无需token访问的url\r\n      release-urls:\r\n        - /actuator/**\r\n        - /v2/api-docs\r\n        - /api/**\r\n        - /shopapply/addedit\r\n        - /shopinfo/count\r\n        - /shopapply/one\r\n        - /orderrefunds/notify-refunds\r\n        - /order-info-nc/page\r\n        - /order-info-nc/editNcStatus\r\n        - /order-info-nc/log\r\n        - /order-info-nc/save-failed-reason\r\n# 数据源配置\r\nspring:\r\n  cloud:\r\n    stream:\r\n      rocketmq: \r\n        binder:\r\n          name-server: rocketmq-nameserver.default:9876\r\n        bindings:\r\n          distributionTaskInviteDistributionUser-out-0:\r\n            producer:\r\n              group: distributionTaskInviteDistributionUser_group\r\n          distributionTaskRefunds-out-0:     \r\n            producer:\r\n              group: distributionTaskRefunds_group\r\n          jikeyun_push_order_out-0:\r\n            producer:\r\n              sync: true\r\n              group: jikeyunPushOrder_group\r\n          jikeyun_push_order_refund_out-0:\r\n            producer:\r\n              sync: true\r\n              group: jikeyunPushOrderRefund_group\r\n          userBehaviorEvents-out-0:\r\n            producer:\r\n              group: userBehaviorEvents_group\r\n          crowdOperationMiniNotification-out-0:\r\n            producer:\r\n              group: crowdOperationMiniNotification_group\r\n          sendSms-out-0:\r\n            producer:\r\n              group: sendSms_group\r\n      bindings:\r\n        distributionTaskInviteDistributionUser-out-0:\r\n          destination: distributionTask-invite-distributionUser\r\n        distributionTaskRefunds-out-0:\r\n          destination: distributionTask-refunds\r\n        jikeyun_push_order_out-0:\r\n  